import React from 'react';
import './SideBar.css';
import Logo from '../../img/logo.png';
import { IconContext } from "react-icons";
import { BiHomeAlt, BiSearch, BiMenuAltRight } from "react-icons/bi";

export default function SideBar() {
    return (
        <div className="SideBar">
        <img src={Logo} alt="" className="logo"/>
        <div className="buttons">
        <IconContext.Provider value={{ color: "#a3a3a3", className: "global-class-name", size: "25px" }}>
            <div className="button">
            <BiHomeAlt/> <p>In√≠cio</p>
            </div>
        </IconContext.Provider>
        <IconContext.Provider value={{ color: "#a3a3a3", className: "global-class-name", size: "25px" }}>
            <div className="button search">
            <BiSearch/> <p>Buscar</p>
            </div>
        </IconContext.Provider>
        <IconContext.Provider value={{ color: "#a3a3a3", className: "global-class-name", size: "25px" }}>
            <div className="button you">
            <BiMenuAltRight/> <p>Sua Biblioteca</p>
            </div>
        </IconContext.Provider>
        </div>
        </div>
    )
}
